function showsvn(){
    $.layer.confirm('<div style="padding:20px;"><input type="text" autofocus style="width:98%;" placeholder="请输入博主的真实姓名" autocomplete="off" /></div>', function(main){
        if($.trim(main.find(':text').val()) === '尹加增'){
            $.layer({
                content:'<p style="padding:20px;"><input type="text" style="width:98%;" autocomplete="off" value="svn://git.oschina.net/zjaisinofe/axnfex" /></p>',
                width:280,
                button:{
                    cancel:{
                        text:'关闭'
                    },
                    confirm:{
                        text:'复制',
                        callback:function(main, index, btn){
                            var input  = main.find(':text');
                            input.select();
                            document.execCommand('Copy');
                            btn.text('复制成功');
                            setTimeout(function(){
                                btn.text('复制')
                            }, 1000)
                        }
                    }
                }
            })
        }
        else{
            $.layer({
                content:'<img src="data:image/jpeg;base64,">',
                width:240,
                height:204,
                timer:3000,
                close:{
                    enable:false
                },
                title:{
                    enable:false
                }
            })
        }
        return true
    }, '', 280)
}